import React from 'react';
import ReactDOM from 'react-dom';

let a = new Date(2022,7,21,18);
let b = a.getHours();
let c = '';

if (b >= 0 && b < 12) {
    c = 'Good Morning';
}
else if (b >= 12 && b < 19) {
    c = 'Good Afternoon';
}
else if (b >= 19 && b <20 ) {
    c = 'Good evening';
}
else {
    c = 'Good Night';
}

ReactDOM.render(
    <>
        <h1>Hello sir, <span>{c}</span> </h1>
    </>,
    document.getElementById('root')
);
